import React from "react";
import "./Home.css";
import Navbar from "../components/Navbar";

export default function Home() {
  return (
    <div>
      <Navbar />
      <div className="page">
        <div className="banner" id="left"></div>
        <div className="banner" id="center"></div>
        <div className="banner" id="right"></div>
      </div>
    </div>
  );
}
